import React, { useState } from 'react';
import "../../styles/Register.css";
import Popup from '../../components/Popup';


const PatientRegister = () => {
  const [username, setUsername] = useState('');
  const [firstName, setFirstName] = useState('');
  const [middleName, setMiddleName] = useState('');
  const [lastName, setLastName] = useState('');
  const [age, setAge] = useState('');
  const [sex, setSex] = useState('');
  const [birthday, setBirthday] = useState('');
  const [address, setAddress] = useState('');
  const [contactNumber, setContactNumber] = useState('');
  const [email, setEmail] = useState('');
  const [seniorId, setSeniorId] = useState('');
  const [pwdId, setPwdId] = useState('');
  const [philhealthId, setPhilhealthId] = useState('');
  const [hmo, setHmo] = useState('');
  const [password, setPassword] = useState('');
  const [retypePassword, setRetypePassword] = useState('');
  const [signupMessage, setSignupMessage] = useState('');
  const [otp, setOtp] = useState('');
  const [message, setMessage] = useState('');
  const [userType] = useState('patient');
  const [registrationSuccessful, setRegistrationSuccessful] = useState(false);



  const handleSignup = async () => {
    // Check if any of the fields are empty
    if (
      !username ||
      !firstName ||
      !middleName ||
      !lastName ||
      !age ||
      !sex ||
      !birthday ||
      !address ||
      !contactNumber ||
      !email ||
      !password ||
      !retypePassword
    ) {
      setSignupMessage('Please fill in all required fields.');
      return;
    }
    if (password !== retypePassword) {
      setSignupMessage('Passwords do not match.');
      return;
    }

    // Validate password length
    if (password.length < 7 || !/\d/.test(password)) {
      setSignupMessage('Password should be at least 7 characters long and must contain at least 1 number.');
      return;
    }

    const contactNumberRegex = /^\d{11}$/;
    if (!contactNumberRegex.test(contactNumber)) {
      setSignupMessage('Contact number should be exactly 11 digits and contain only numbers (0-9).');
      return;
    }

    // Validate email format using regular expression
    const emailRegex = /^\w+([.-]?\w+)*@\w+([.-]?\w+)*(\.\w{2,3})+$/;
    if (!emailRegex.test(email)) {
      setSignupMessage('Invalid email format.');
      return;
    }

    try {
      const url = new URL('http://localhost:8080/patients');
      const userData = {
        user: {
        username,
        firstName,
        middleName,
        lastName,
        age,
        sex,
        birthday,
        address,
        contactNumber,
        email,
        password,
        userType
      },
        patient: {
        seniorId,
        pwdId,
        philhealthId,
        hmo
        }
      };


      const response = await fetch(url, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(userData),
      });

      if (response.ok) {
        // Signup successful
        setSignupMessage('User added successfully');
        setRegistrationSuccessful(true);


      } else {
        // Signup failed
        const errorMessage = await response.text();
        setSignupMessage(`Signup failed`);
        // Handle the error or display an error message to the user
      }
    } catch (error) {
      console.error('Error during signup:', error);
      setSignupMessage('Error during signup. Please try again later.');
      // Handle the error or display an error message to the user
    }
  }


  const handleVerification = async () => {
    try {
      const response = await fetch(`http://localhost:8080/patientverify?email=${email}&otp=${otp}`, {
        method: 'GET',
      });

      if (response.ok) {
        const verificationResult = await response.text();
        setMessage(verificationResult);
        if (verificationResult === 'Successful verification.') {
          window.location.href = '/login'; // Redirect to the login page
        } else {
          setMessage('Unsuccessful verification.');
        }
      } else {
        setMessage('Unsuccessful verification.');
      }
    } catch (error) {
      setMessage('An error occurred');
    }
  };


  const handleOtpChange = (e) => {
    const inputOtp = e.target.value;
    setOtp(inputOtp);
  };

  return (
    <div className="reg-container" id="reg-container">
      <div className="register">
        <h1 style={{ color: '#0094d4' }}>Patient Register</h1>
        <form action="#" id="register-form">
          <div className="reg-row">
            <div className="reg-infield">
              <input 
                type="text"
                id="username"
                placeholder="*Username"
                name="username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              style={{ display: 'flex', flexDirection: 'row', justifyContent: 'space-between', width: '690px' }} />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input type="text"
                id="lastName"
                placeholder="*Last Name"
                name="lastName"
                value={lastName}
                onChange={(e) => setLastName(e.target.value)}/>
            </div>
            <div className="reg-infield">
              <input  type="text"
                id="firstName"
                placeholder="*First Name"
                name="firstName"
                value={firstName}
                onChange={(e) => setFirstName(e.target.value)} />
            </div>
            <div className="reg-infield">
              <input type="text"
                id="middleName"
                placeholder="Middle Name"
                name="middleName"
                value={middleName}
                onChange={(e) => setMiddleName(e.target.value)} />
            </div>
          </div>

          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="number"
                id="age"
                placeholder="*Age"
                name="age"
                min="1"
                max="100"
                value={age}
                onChange={(e) => setAge(e.target.value)}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                id="sex"
                placeholder="*Sex"
                name="sex"
                value={sex}
                onChange={(e) => setSex(e.target.value)}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield" style={{ width: "50px", marginRight: "-10"}}> 
              <p style={{margin: "0", padding: "10px 0", color: "grey", fontSize: "12px"}}>*Birthdate</p>
            </div>
            <div className="reg-infield" style={{ width: "150px"}}>
              <input
                type="date"
                id="birthday"
                name="birthday"
                value={birthday}
                style={{padding: "8px 8px"}}
                onChange={(e) => setBirthday(e.target.value)}
              />
            </div>
            <div className="reg-infield" style={{ width: "500px"}}>
              <input
                type="text"
                id="address"
                placeholder="*(House/Lot/Unit No., Street, Barangay, City/Town, Province)"
                name="address"
                value={address}
                onChange={(e) => setAddress(e.target.value)}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                id="contactNumber"
                placeholder="*Contact Number"
                name="contactNumber"
                value={contactNumber}
                onChange={(e) => setContactNumber(e.target.value)}
              />
            </div>
            <div className="reg-infield">
              <input
                type="email"
                placeholder="Email"
                id="email"
                name="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                placeholder="Senior Citizen ID Number"
                id="seniorId"
                name="seniorId"
                value={seniorId}
                onChange={(e) => setSeniorId(e.target.value)}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                placeholder="PWD ID Number"
                id="pwdId"
                name="pwdId"
                value={pwdId}
                onChange={(e) => setPwdId(e.target.value)}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                placeholder="PhilHealth ID Number"
                id="philhealthId"
                name="philhealthId"
                value={philhealthId}
                onChange={(e) => setPhilhealthId(e.target.value)}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                placeholder="Health Insurance/HMO"
                id="hmo"
                name="hmo"
                value={hmo}
                onChange={(e) => setHmo(e.target.value)}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="password"
                placeholder="*Password"
                id="password"
                name="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
            <div className="reg-infield">
              <input
                type="password"
                placeholder="*Re-enter Password"
                id="retypePassword"
                name="retypePassword"
                value={retypePassword}
                onChange={(e) => setRetypePassword(e.target.value)}
              />
            </div>
          </div>

          {signupMessage && <p className="signup-message">{signupMessage}</p>}
          <button type="button" onClick={handleSignup}> Register</button>
          {registrationSuccessful && (
          <Popup trigger={true}>
            <form action="#" id="signin-form">
              <div className="infield">
                <h1 style={{ textAlign: 'center' }}>Verification</h1>
                <input
                  type="code"
                  placeholder="Verification Code"
                  id="otp"
                  value={otp}
                  onChange={handleOtpChange}
                />
              </div>
              <button type="button" onClick={handleVerification}>Submit Code</button>
              {message && <p>{message}</p>}
              <p style={{ color: '#0094d4', marginTop: '0', marginBottom: '0' }}>Did not receive it? <a href='/'>Resend Code</a></p>
            </form>
          </Popup>
          )} 
        </form>
      </div>
    </div>
  );
};

export default PatientRegister;
